import React from "react";
import {useNavigate} from 'react-router-dom'
import "./Navbar.css";
function Navbar() {

  const navigate = useNavigate();

  return (
    <div className="nav">
      <h1>pappergrid</h1>
      <ol>

        <li onClick={()=>{navigate('/shop')}}>shop</li>
        <li>lookbook</li>
        <li>About</li>
        <li>Contact</li>
        <img alt="cart" src="https://img.icons8.com/ios/20/undefined/shopping-cart-loaded--v1.png"/>
        <img  className="menu" alt="menu"  src="https://img.icons8.com/ios/50/undefined/menu--v1.png"/>

      </ol>
    </div>
  );
}

export default Navbar;
